/** Get last 5 tweets */if($("#twitter").length){console.log("Get last five tweets.");$.ajax({type:"GET",dataType:"jsonp",cache:!1,url:"http://api.twitter.com/1/statuses/user_timeline.json?screen_name=nassia&count=5",success:function(e){$.each(e,function(e,t){$("#twitter").append("<p>"+t.text+"</p><small>"+t.created_at+"</small><hr/>")})}})}if($("#instagram").length){console.log("Get last five instagram pictures.");$.ajax({type:"GET",dataType:"jsonp",cache:!1,url:"https://api.instagram.com/v1/users/21311155/media/recent/?access_token=21311155.ab103e5.a7a20249e87f4a4db3614c2c3a203804",success:function(e){var t="<ul class='thumbnails'>";$.each(e.data,function(e,n){t+='<li><a href="'+n.link+'" target="_blank"><img src="'+n.images.thumbnail.url+'" title="'+n.caption.text+'"></a></li>'});t+="</ul>";$("#instagram").append(t)}})};